description:
Be an ultimate treasure hunter and earn big money at the auction.....

Pickers: Adventures in Rust
You're on the lookout for unusual and valuable items to fill your shop, Rusted Gold. Turn a quick profit or refurbish your finds to earn big money at auction. Collect and appraise valuable items and haggle with buyers. Are you ready to become the ultimate Picker?
